g\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/ROOT/__init__.py')\n\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"3612","type":"Div"},{"attributes":{"days":[1,15]},"id":"3539","type":"DaysTicker"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"3426","type":"DataRange1d"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"3761","type":"AdaptiveTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"3249"},"glyph":{"id":"3278"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"3280"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"3282"}},"id":"3281","type":"GlyphRenderer"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"3537","type":"DaysTicker"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"3723"},{"id":"3724"},{"id":"3725"},{"id":"3726"},{"id":"3727"},{"id":"3728"},{"id":"3729"},{"id":"3730"},{"id":"3731"},{"id":"3732"},{"id":"3733"},{"id":"3734"}]},"id":"3438","type":"DatetimeTicker"},{"attributes":{},"id":"3696","type":"AllLabels"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"3307","type":"BoxAnnotation"},{"attributes":{"child":{"id":"3612"},"title":"Summary"},"id":"3613","type":"Panel"},{"attributes":{},"id":"3772","type":"YearsTicker"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"3533","
